import React from "react";
import git from "../imagens/RedesSociais/git.png";
import face from "../imagens/RedesSociais/face.png";
import lin from "../imagens/RedesSociais/lin.png";
import { Link } from "react-router-dom";



const Footer = () => (
    <footer>
        <h2>Cuidado! o Shaco está na Espreita! Se esconda!</h2>
        <Link to="https://www.facebook.com/matheus.ribasdesouza/">
            <img src={face} />
        </Link>
        <Link to="https://www.linkedin.com/in/matheus-henrique-ribas-de-souza-89709b224/">
            <img src={lin} />
        </Link>
        <a href="https://github.com/ZinhoTTV">
            
        </a>
    </footer>
);

export default Footer;
